<h4>Version 1.5.0 - Released on Oct 10, 2017 </h4>
<ul>
    <li>New: Support to WooCommerce 3.2.0 RC2.</li>
    <li>Update: Plugin core.</li>
    <li>Tweak: Use of transients to increase plugin speed and performance.</li>
    <li>Dev: Added filter yith_wccl_skip_form_variable_loop to skip adding the variation form in the loop for specific products or under specific conditions.</li>
</ul>
<h4>Version 1.4.0 - Released on Sep 11, 2017 </h4>
<ul>
	<li>New: Support to WooCommerce 3.1.2.</li>
	<li>New: Support to WordPress 4.8.1.</li>
	<li>New: Compatibility with Flatsome Quick View.</li>
	<li>New: Compatibility with WooCommerce Ajax Filter.</li>
	<li>New: Dutch translate ( thanks to Boaz van der Zeep ).</li>
	<li>New: Option to enable AJAX handle for variations form in archive shop pages.</li>
	<li>Update: Plugin core.</li>
	<li>Update: Languages file.</li>
	<li>Fix: "Add New Attribute" popup not showing in post-new.php pages.</li>
	<li>Fix: Compatibility issue with WP version older then 4.5.</li>
	<li>Fix: Closing key tag missing for wpml-config.xml</li>
</ul>
<h4>Version 1.3.0 - Released on Mar 13, 2017 </h4>
<ul>
    <li>New: Support to WooCommerce 2.7.0 RC1.</li>
    <li>New: Support Ajax variations on single product page.</li>
    <li>Update: Plugin core.</li>
    <li>Fix: YITH Infinite Scrolling compatibility issue.</li>
    <li>Dev: New filter yith_wccl_create_custom_attributes_term_attr.</li>
</ul>
<h4>Version 1.2.1 - Released on Nov 17, 2016 </h4>
<ul>
    <li>New: Support to WP-Rocket LazyLoad.</li>
    <li>Fix: Notice undefined index on class YITH_WCCL_Frontend.</li>
</ul>
<h4>Version 1.2.0 - Released on Oct 06, 2016 </h4>
<ul>
    <li>New: Change product image on hover (only for one attirbute).</li>
    <li>New: Option to show custom attributes style also on "Additional Information" Tab.</li>
    <li>New: Compatibility with WooCommerce Products Filter.</li>
    <li>New: Compatibility with YITH Composite Products For WooCommerce.</li>
    <li>Update: Language files.</li>
    <li>Update: Core plugin.</li>
    <li>Fix: Reset attribute type on plugin deactivation.</li>
</ul>
<h4>Version 1.1.0 - Released on Jul 25, 2016 </h4>
<ul>
	<li>New: Spanish translation.</li>
	<li>New: Compatibility with WooCommerce Quick View by WooThemes.</li>
    <li>Update: Language files.</li>
    <li>Update: Core plugin.</li>
	<li>Fix: Description and default variations on archive pages.</li>
</ul>
<h4>Version 1.0.9 - Released on Jun 07, 2016 </h4>
<ul>
    <li>New: Italian translation.</li>
    <li>Update: Language files.</li>
    <li>Update: Core plugin.</li>
    <li>Fix: Default variation on single product pages for products with only one attribute</li>
</ul>
<h4>Version 1.0.8 - Released on May 23, 2016 </h4>
<ul>
    <li>New: Compatibility with YITH WooCommerce Added to Cart Popup.</li>
    <li>New: Set dual color such as blue-white (half box blue and half box white).</li>
    <li>New: Show a preview of the attribute image in the tooltip (available only for image attributes).</li>
    <li>New: Support to WordPress 4.5.2.</li>
    <li>New: Support to WooCommerce 2.6 Beta2.</li>
    <li>Update: Updated textdomain from yith-wccl to yith-woocommerce-color-label-variations.</li>
    <li>Update: Language files.</li>
    <li>Update: Core plugin.</li>
    <li>Fix: Clicking on selected attribute before selecting another one is no longer necessary.</li>
    <li>Fix: Variations now work with Owl Carousel 2 when infinite loop option is set.</li>
</ul>
<h4>Version 1.0.7 - Released on Dec 14, 2015 </h4>
<ul>
    <li>New: Compatibility with WooThumbs Awesome Product Imagery plugin</li>
    <li>New: Compatibility with YITH WooCommerce Gift Card</li>
</ul>
<h4>Version 1.0.5 - Released on Sep 18, 2015 </h4>
<ul>
    <li>Fix: Add to cart variation out-of-stock in shop page</li>
</ul>
<h4>Version 1.0.4 - Released on Sep 17, 2015 </h4>
<ul>
    <li>New: Blur effect for product attributes. Activate it on plugin settings page.</li>
    <li>New: Compatibility with YITH Infinite Scrolling</li>
    <li>New: Out of stock label in shop if selected variation is out of stock</li>
    <li>New: ITA Translation</li>
    <li>Update: Core plugin</li>
    <li>Fix: Default variation on shop page</li>
    <li>Fix: Replace fragments after add to cart action</li>
</ul>
<h4>Version 1.0.3 - Released on Aug 12, 2015 </h4>
<ul>
    <li>New: Compatibility with WooCommerce 2.4</li>
    <li>New: WP 4.2.4 compatibility</li>
    <li>New: Option for choose the form position in archive shop page</li>
    <li>Update: Core plugin</li>
    <li>Fix: Multiple view cart on shop page</li>
</ul>
<h4>Version 1.0.2 - Released on Jun 25, 2015 </h4>
<ul>
    <li>New: Ajax Navigation compatibility</li>
    <li>Fix: Minor bugs</li>
</ul>
<h4>Version 1.0.1 - Released on Jun 23, 2015 </h4>
<ul>
    <li>Update: plugin core</li>
    <li>Fix: minor bugs</li>
    <li>Fix: js error</li>
</ul>
<h4>Version 1.0.0 - Released on Jun 09, 2015</h4>
<ul>
    <li>Initial Release</li>
